DROP TABLE IF EXISTS `mst_sku`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `mst_sku` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `description` varchar(255) DEFAULT NULL,
  `prefix` varchar(50) DEFAULT NULL,
  `flag_sku_type` tinyint(1) DEFAULT NULL COMMENT '1 : finished goods\r\n2 : production materials\r\n3 : general items',
  `flag_sku_procurement_type` tinyint(1) DEFAULT NULL COMMENT '1 : in-house\r\n2 : purchase\r\n3 : supply\r\n4 : purchase & in-house',
  `flag_inventory_register` tinyint(1) NOT NULL DEFAULT 1,
  `flag_active` tinyint(1) DEFAULT NULL,
  `flag_show` tinyint(1) DEFAULT NULL,
  `group_tag` varchar(50) DEFAULT NULL,
  `counter` smallint(6) DEFAULT NULL,
  `set_code_counter` smallint(6) DEFAULT NULL,
  `specification_code` varchar(50) DEFAULT NULL,
  `specification_detail` varchar(100) DEFAULT NULL,
  `val_weight` decimal(20,4) DEFAULT NULL,
  `val_area` decimal(20,4) DEFAULT NULL,
  `val_conversion` decimal(20,4) DEFAULT NULL,
  `blob_image` mediumblob DEFAULT NULL,
  `created_by` varchar(50) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_by` varchar(50) DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_by` varchar(50) DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `manual_id` varchar(50) DEFAULT NULL,
  `generated_id` varchar(64) DEFAULT NULL,
  `sku_type_id` bigint(20) DEFAULT NULL,
  `sku_unit_id` bigint(20) DEFAULT NULL,
  `sku_model_id` bigint(20) DEFAULT NULL,
  `sku_process_id` bigint(20) DEFAULT NULL,
  `sku_business_type_id` bigint(20) DEFAULT NULL,
  `sku_packaging_id` bigint(20) DEFAULT NULL,
  `sku_detail_id` bigint(20) DEFAULT NULL,
  `sku_procurement_unit_id` bigint(20) DEFAULT NULL,
  `sku_inventory_unit_id` bigint(20) DEFAULT NULL,
  `sku_sales_category_id` bigint(20) DEFAULT NULL,
  `set_code` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `IXFK_mst_sku_mst_sku_business_type` (`sku_business_type_id`),
  KEY `IXFK_mst_sku_mst_sku_detail` (`sku_detail_id`),
  KEY `IXFK_mst_sku_mst_sku_model` (`sku_model_id`),
  KEY `IXFK_mst_sku_mst_sku_packaging` (`sku_packaging_id`),
  KEY `IXFK_mst_sku_mst_sku_process` (`sku_process_id`),
  KEY `IXFK_mst_sku_mst_sku_type` (`sku_type_id`),
  KEY `IXFK_mst_sku_mst_sku_unit` (`sku_unit_id`),
  KEY `FK_mst_sku_sku_inventory_unit_id` (`sku_inventory_unit_id`),
  KEY `FK_mst_sku_sku_procurement_unit_id` (`sku_procurement_unit_id`),
  KEY `FK_mst_sku_sku_sales_category_id` (`sku_sales_category_id`),
  CONSTRAINT `FK_mst_sku_mst_sku_business_type` FOREIGN KEY (`sku_business_type_id`) REFERENCES `mst_sku_business_type` (`id`),
  CONSTRAINT `FK_mst_sku_mst_sku_detail` FOREIGN KEY (`sku_detail_id`) REFERENCES `mst_sku_detail` (`id`),
  CONSTRAINT `FK_mst_sku_mst_sku_model` FOREIGN KEY (`sku_model_id`) REFERENCES `mst_sku_model` (`id`),
  CONSTRAINT `FK_mst_sku_mst_sku_packaging` FOREIGN KEY (`sku_packaging_id`) REFERENCES `mst_sku_packaging` (`id`),
  CONSTRAINT `FK_mst_sku_mst_sku_process` FOREIGN KEY (`sku_process_id`) REFERENCES `mst_sku_process` (`id`),
  CONSTRAINT `FK_mst_sku_mst_sku_type` FOREIGN KEY (`sku_type_id`) REFERENCES `mst_sku_type` (`id`),
  CONSTRAINT `FK_mst_sku_mst_sku_unit` FOREIGN KEY (`sku_unit_id`) REFERENCES `mst_sku_unit` (`id`),
  CONSTRAINT `FK_mst_sku_sku_inventory_unit_id` FOREIGN KEY (`sku_inventory_unit_id`) REFERENCES `mst_sku_unit` (`id`),
  CONSTRAINT `FK_mst_sku_sku_procurement_unit_id` FOREIGN KEY (`sku_procurement_unit_id`) REFERENCES `mst_sku_unit` (`id`),
  CONSTRAINT `FK_mst_sku_sku_sales_category_id` FOREIGN KEY (`sku_sales_category_id`) REFERENCES `mst_sku_sales_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10638 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci AVG_ROW_LENGTH=251 ROW_FORMAT=DYNAMIC;
