CREATE  PROCEDURE `sp_report_generate_sku_outstanding`(IN trg_date date, IN trg_createdby varchar(50))
BEGIN

  #Delete Current Record

  DELETE

    FROM report_sku_outstanding

  WHERE report_date = trg_date;



  #Insert New Record

  INSERT INTO report_sku_outstanding (sku_id, qty, report_date, flag_in_out, flag_transaction, created_by, created_at)



    #1. Outstanding PO (belum masuk SDS)

    SELECT

      vaptpd.sku_id,

      COALESCE(SUM(vaptpd.qty_outstanding), 0),

      trg_date,

      1,

      1,

      trg_createdby,

      NOW()

    FROM vw_app_pick_trans_po_dt vaptpd

      INNER JOIN vw_app_pick_trans_po_hd vaptph

        ON vaptpd.trans_po_id = vaptph.id

    WHERE vaptph.trans_date <= trg_date

    GROUP BY vaptpd.sku_id



    UNION ALL



    #2. Outstanding SDS (belum masuk DO)

    SELECT

      vaptsd.sku_id,

      SUM(vaptsd.qty_outstanding),

      trg_date,

      1,

      2,

      trg_createdby,

      NOW()

    FROM vw_app_pick_trans_sds_dt vaptsd

      INNER JOIN vw_app_pick_trans_sds_hd vaptsh

        ON vaptsd.trans_sds_id = vaptsh.id

    WHERE vaptsh.trans_date <= trg_date

    GROUP BY vaptsd.sku_id



    UNION ALL



    #3. Outstanding DO (belum masuk Receiving/RR)

    SELECT

      vaptdd.sku_id,

      SUM(vaptdd.qty_outstanding),

      trg_date,

      1,

      3,

      trg_createdby,

      NOW()

    FROM vw_app_pick_trans_do_dt vaptdd

      INNER JOIN vw_app_pick_trans_do_hd vaptdh

        ON vaptdd.trans_do_id = vaptdh.id

    WHERE vaptdh.trans_date <= trg_date

    GROUP BY vaptdd.sku_id;

END ;;
