CREATE  PROCEDURE `sp_report_generate_sku_stock_balance`(IN trg_date bigint, IN trg_createdby varchar(50))
BEGIN

  DECLARE prev_date date;



  SET prev_date = (SELECT

      MAX(rssb.report_date)

    FROM report_sku_stock_balance rssb

    WHERE rssb.report_date < trg_date LIMIT 1);



  #Delete Current Record

  DELETE

    FROM report_sku_stock_balance

  WHERE report_date = trg_date;



  #Insert New Record

  INSERT INTO report_sku_stock_balance (sku_id, qty_opening, qty_debit, qty_credit, qty_balance, report_date, created_by, created_at)



    SELECT

      a.sku_id,

      SUM(a.qty_opening) AS qty_opening,

      SUM(a.qty_debit) AS qty_debit,

      SUM(a.qty_credit) AS qty_credit,

      SUM(a.qty_balance) AS qty_balance,

      trg_date,

      trg_createdby,

      NOW()

    FROM (

      #1. Get Previous Balance

      SELECT

        rssb.sku_id,

        rssb.qty_balance AS qty_opening,

        0 AS qty_debit,

        0 AS qty_credit,

        rssb.qty_balance AS qty_balance

      FROM report_sku_stock_balance rssb

      WHERE rssb.report_date = prev_date



      UNION ALL



      #2. Get Receiving Record

      SELECT

        valtrd.sku_id,

        0 AS qty_opening,

        valtrd.qty AS qty_debit,

        0 AS qty_credit,

        valtrd.qty AS qty_balance

      FROM vw_app_list_trans_rr_dt valtrd

        INNER JOIN vw_app_list_trans_rr_hd valtrh

          ON valtrd.trans_rr_id = valtrh.id

      WHERE valtrh.trans_date = trg_date



      UNION ALL



      #3. Get Opening Stock (if exist)

      SELECT

        tsos.sku_id,

        tsos.qty AS qty_opening,

        0 AS qty_debit,

        0 AS qty_credit,

        tsos.qty AS qty_balance

      FROM trans_sku_opening_stock tsos

      WHERE tsos.trans_date = trg_date) a

    GROUP BY a.sku_id;

END ;;
DELIMITER ;
