CREATE  PROCEDURE `sp_trans_pi_receipt`(IN trg_trans_pi_id bigint, IN trg_phase smallint, IN trg_user_id varchar(50))
BEGIN

	

  #Insert 

  INSERT INTO trans_purchase_invoice_receipt (trans_pi_id,trans_date, flag_status, prs_user_id, created_by,

  created_at, generated_id, receipt_phase) values

  (trg_trans_pi_id, CURRENT_DATE(),1,trg_user_id,trg_user_id,CURRENT_TIMESTAMP(), uuid(),trg_phase);

 

 if trg_phase = 3 then 

 	update trans_purchase_invoice

 		set flag_approval_status = 1,

 		approval_date = now()

 		where id = trg_trans_pi_id;

 end if;

 

END ;;
