CREATE  PROCEDURE `sp_trans_pi_rollback`(IN trg_trans_pi_id bigint, IN trg_phase smallint, IN trg_user_id varchar(50))
BEGIN

	

  #Delete

delete

from

	trans_purchase_invoice_receipt

where

	trans_pi_id = trg_trans_pi_id

	and receipt_phase > trg_phase;



 

 if trg_phase < 3 then 

 	update trans_purchase_invoice

 		set flag_approval_status = null,

 		approval_date = null

 		where id = trg_trans_pi_id;

 end if;

 

END ;;
