CREATE  PROCEDURE `sp_trans_pr_create_po`(IN trg_trans_pr_id bigint, 

IN trg_mst_supplier_id bigint, 

IN trg_mst_terms_dt_id bigint, 

IN trg_trans_date date, 

IN trg_valid_from_date date, 

IN trg_valid_to_date date, 

IN trg_description varchar(100), 

IN trg_doc_num varchar(50), 

IN trg_doc_counter smallint,

IN trg_attention varchar(50),

IN trg_subtotal_d decimal(20,4),

IN trg_subtotal_f decimal(20,4) ,

IN trg_discount_percentage decimal(20,4) ,

IN trg_discount_d decimal(20,4) ,

IN trg_discount_f decimal(20,4) ,

IN trg_vat_percentage decimal(20,4),

IN trg_vat_d decimal(20,4) ,

IN trg_vat_f decimal(20,4) ,

IN trg_pph23_percentage decimal(20,4),

IN trg_pph23_d decimal(20,4) ,

IN trg_pph23_f decimal(20,4) ,

IN trg_total_d decimal(20,4) ,

IN trg_total_f decimal(20,4) )
BEGIN

  DECLARE trg_trans_po_id bigint;



  #Insert Header

  INSERT INTO trans_purchase_order (trans_date, description, doc_num, doc_counter, flag_status, valid_from_date, valid_to_date, rev_counter, rev_date, flag_type,

  flag_active, val_exchangerates, created_by, created_at, gen_terms_detail_id, gen_currency_id, gen_department_id,

  prs_supplier_id, purchase_request_id, manual_id, generated_id,

  attention, subtotal_d, subtotal_f,discount_percentage, discount_d, discount_f, 

  vat_percentage, vat_d, vat_f,pph23_percentage, pph23_d, pph23_f, total_d, total_f)

    SELECT

      trg_trans_date,

      trg_description,

      trg_doc_num,

      trg_doc_counter,

      tpr.flag_status,

      trg_valid_from_date,

      trg_valid_to_date,

      0,

      CURRENT_DATE(),

      tpr.flag_type,

      1,

      tpr.val_exchangerates,

      tpr.created_by,

      NOW(),

      trg_mst_terms_dt_id,

      tpr.gen_currency_id,

      tpr.gen_department_id,

      tpr.prs_supplier_id,

      tpr.id,

      tpr.manual_id,

      tpr.generated_id,

      trg_attention,    

      trg_subtotal_d,

      trg_subtotal_f ,

      trg_discount_percentage ,

      trg_discount_d ,

      trg_discount_f ,

      trg_vat_percentage ,

      trg_vat_d,

      trg_vat_f,

      trg_pph23_percentage ,

      trg_pph23_d,

      trg_pph23_f,

      trg_total_d,

      trg_total_f

    FROM trans_purchase_request tpr

    WHERE tpr.id = trg_trans_pr_id;



  #Insert Detail

  SET trg_trans_po_id = LAST_INSERT_ID();



  INSERT INTO trans_purchase_order_detail (description, sku_description, sku_prefix, price_d, price_f, qty, subtotal_d, subtotal_f, discount_flag, discount_percentage, discount_d, discount_f,

  afterdiscount_d, afterdiscount_f, vat_flag, vat_percentage, vat_d, vat_f, total_d, total_f, created_by, created_at, updated_by, updated_at, deleted_by,

  deleted_at, manual_id, generated_id, trans_po_id, sku_id, req_date, pr_detail_id,moq)

    SELECT

      tprd.description,

      tprd.sku_description,

      tprd.sku_prefix,

      tprd.price_d,

      tprd.price_f,

      tprd.qty,

      tprd.subtotal_d,

      tprd.subtotal_f,

      tprd.discount_flag,

      tprd.discount_percentage,

      tprd.discount_d,

      tprd.discount_f,

      tprd.afterdiscount_d,

      tprd.afterdiscount_f,

      tprd.vat_flag,

      tprd.vat_percentage,

      tprd.vat_d,

      tprd.vat_f,

      tprd.total_d,

      tprd.total_f,

      tprd.created_by,

      tprd.created_at,

      tprd.updated_by,

      tprd.updated_at,

      tprd.deleted_by,

      tprd.deleted_at,

      tprd.manual_id,

      tprd.generated_id,

      trg_trans_po_id,

      tprd.sku_id,

      tprd.req_date,

      tprd.id,

      tprd.moq

    FROM trans_purchase_request_detail tprd

    WHERE tprd.trans_pr_id = trg_trans_pr_id

    AND tprd.flag_status = 1;



  #Update PR Status

  UPDATE trans_purchase_request

  SET flag_status = 3

  WHERE id = trg_trans_pr_id;

END ;;
