CREATE  PROCEDURE `sp_trans_rr_import_do`(IN trg_date date, IN trg_supplier_id bigint, IN trg_do_detail_id bigint, IN trg_remark varchar(100), IN trg_createdby varchar(50), IN trg_qty decimal(20, 4), IN trg_transaction tinyint)
BEGIN

  DECLARE new_rr_id bigint;
  DECLARE v_po_id bigint;
  DECLARE v_os_qty_rr decimal(40,0);



  #Insert Header

  INSERT INTO trans_receiving (trans_date, doc_num, flag_active, created_by, created_at, prs_supplier_id, flag_transaction)

    SELECT

      trg_date,

      'RR',

      1,

      trg_createdby,

      CURRENT_TIMESTAMP(),

      trg_supplier_id,

      trg_transaction

    FROM vw_app_list_trans_do_dt valtdd

    WHERE valtdd.id = trg_do_detail_id;



  SET new_rr_id = LAST_INSERT_ID();



  #Insert Detail

  INSERT INTO trans_receiving_detail (description, qty, created_by, created_at, trans_rr_id, do_detail_id)

    SELECT

      trg_remark,

      trg_qty,

      trg_createdby,

      CURRENT_TIMESTAMP(),

      new_rr_id,

      trg_do_detail_id

    FROM vw_app_list_trans_do_dt valtdd

    WHERE valtdd.id = trg_do_detail_id;

    #### CHECK QTY HAS FULLY RECEIVED OR NO, IF YES THEN UPDATE PO AS CLOSED
	 select
		tpod.trans_po_id into v_po_id
	 from
		trans_purchase_order_detail tpod
		join trans_supplier_delivery_schedule_detail tsdsd 
		on tsdsd.po_detail_id = tpod.id
		join yrhmyid_db_edi.trans_delivery_order_detail tdod
		on tdod.sds_detail_id = tsdsd.id
	 where
		tdod.id = trg_do_detail_id
	limit 1;


	select
		sum(outstanding_rr) into v_os_qty_rr
	from
		vw_app_list_trans_po_dt
	where
		trans_po_id = v_po_id;

  if v_os_qty_rr <= 0 then 
   update trans_purchase_order 
     set flag_status = 5
    where id = v_po_id;
  end if;
  #### CHECK QTY HAS FULLY RECEIVED OR NO, IF YES THEN UPDATE PO AS CLOSED
   

  #Update DO Status

  CALL sp_log_do_status(trg_do_detail_id, 2, trg_createdby);

END ;;
DELIMITER ;
