CREATE  PROCEDURE `sp_trans_sds_reschedule`(IN trg_sds_id bigint, IN trg_new_docnum varchar(50), IN trg_new_counter smallint, IN trg_rev_counter smallint, IN trg_date date, IN trg_createdby varchar(50))
BEGIN

  DECLARE new_sds_id bigint;



  #Insert Header

  INSERT INTO trans_supplier_delivery_schedule (trans_date, description, doc_num, doc_counter, rev_counter, rev_date, flag_status, flag_delivery, flag_shipment,

  flag_active, created_by, created_at, old_id, new_id, manual_id, generated_id, prs_supplier_id)



    SELECT

      trg_date,

      tsds.description,

      trg_new_docnum,

      trg_new_counter,

      trg_rev_counter,

      CURRENT_TIMESTAMP(),

      1,

      tsds.flag_delivery,

      tsds.flag_shipment,

      1,

      trg_createdby,

      CURRENT_TIMESTAMP(),

      trg_sds_id,

      tsds.new_id,

      tsds.manual_id,

      tsds.generated_id,

      tsds.prs_supplier_id

    FROM trans_supplier_delivery_schedule tsds

    WHERE id = trg_sds_id;



  #Insert Detail

  SET new_sds_id = LAST_INSERT_ID();



  INSERT INTO trans_supplier_delivery_schedule_detail (description, qty, created_by, created_at, trans_sds_id, po_detail_id, manual_id, generated_id)



    SELECT

      tsdsd.description,

      tsdsd.qty,

      trg_createdby,

      CURRENT_TIMESTAMP(),

      new_sds_id,

      tsdsd.po_detail_id,

      tsdsd.manual_id,

      tsdsd.generated_id

    FROM trans_supplier_delivery_schedule_detail tsdsd

    WHERE tsdsd.trans_sds_id = trg_sds_id;



  #Update status on old record

  UPDATE trans_supplier_delivery_schedule

  SET flag_status = 4

  WHERE id = trg_sds_id;



  #Update reference on old record

  UPDATE trans_supplier_delivery_schedule

  SET new_id = new_sds_id

  WHERE id = trg_sds_id;



  #Insert log

  CALL sp_log_sds_status(trg_sds_id, 5, trg_createdby);

END ;;
DELIMITER ;
