CREATE  PROCEDURE `sp_trans_sds_sent_edi`(IN trg_sds_id bigint, IN trg_createdby varchar(50))
BEGIN

  #Insert Header

  INSERT INTO yrhmyid_db_edi.tb_supplier_delivery_schedule (date_entry, date_edit, modify_username, sds_number, sds_number_seq, sds_date, department, po_number, pr_number,

  supplier_code, supplier_name, supplier_initials, sds_status, sds_revision_status, sds_revision_date, edi_status,

  delivery_status, shipment_status, sds_sending_date, sds_received_date, sds_pulled_back_date, sds_reschedule_date,

  sds_reschedule_sds_number)



    SELECT

	tsds.created_at as date_entry,

	tsds.updated_at as date_edit,

	coalesce(tsds.updated_by,'SYSTEM') as modify_username,

	tsds.doc_num as sds_number,

	tsds.doc_counter as sds_number_seq,

	tsds.trans_date as sds_date,

	mgd.description as department,

	tpo.doc_num as po_number,

	tpr.doc_num as pr_number,

	mps.manual_id as supplier_code,

	mps.description as supplier_name,

	mps.prefix as supplier_initials,

	case

		`tsds`.`flag_status`

		when 1 then 'Open'

		when 2 then 'Close'

		when 3 then 'Pulled Back'

		when 4 then 'Rescheduled'

		else 'Unknown'

	end AS `sds_status`,

	concat('R', right(concat('000', cast(coalesce(tsds.rev_counter,0) as char(3) charset utf8mb3)), 3)) AS `sds_revision_status`,

	tsds.rev_date as sds_revision_date,

	case

		`vallsh`.`is_sent_to_edi`

		when 1 then 'Sent'

		else '-'

	end AS `edi_status`,

    case

        `tsds`.`flag_delivery`

        when 1 then 'On Schedule'

        else 'Unknown'

    end AS `sds_delivery`,

	case

		`tsds`.`flag_shipment`

		when 1 then 'Not Completely'

		when 2 then 'Completely Received'

	end AS `shimpment_status`,

	coalesce(vallsh.date_edi,now()) as sds_sending_date,

    '-' AS `sds_received_date`,

	vallsh.date_pulled_back AS date_pulled_back,

	vallsh.date_reschedule AS `sds_reschedule_date`,

	tsds1.doc_num as sds_reschedule_sds_number

from

	trans_supplier_delivery_schedule tsds

left join vw_app_list_log_sds_status vallsh on

	tsds.id = vallsh.trans_sds_id

left join trans_supplier_delivery_schedule tsds1 on

	tsds.new_id = tsds1.id

left join trans_purchase_order tpo on

	tpo.id = tsds.trans_po_id

left join mst_general_department mgd on

	mgd.id = tpo.gen_department_id

left join mst_person_supplier mps on

	mps.id = tpo.prs_supplier_id

left join trans_purchase_request tpr on

	tpr.id = tpo.purchase_request_id

    WHERE tsds.id = trg_sds_id;



  #Insert Detail

  INSERT INTO yrhmyid_db_edi.tb_supplier_delivery_schedule_details (date_entry, date_edit, modify_username, sdsd_number, sdsd_number_seq, sds_number, sds_date, po_number,

  pod_number, pr_number, prd_number, department, supplier_code, supplier_name, supplier_initials,

  purchase_item_type, item_code, item_group_code, item_name, spesification_code, spesification_description,

  item_type_category, item_type_sub_category, item_type_name, item_type_classification_status,

  item_type_trading_status, item_type_primary_status, item_type_checking_status, item_type_checking_result_status,

  item_type_bom_status, sales_category_name, inventory_unit, procurement_type, procurement_unit, conversion_value,

  quantity_sds, outstanding_sdo, sds_status,sds_detail_relation_id)

 SELECT

    distinct

	tsds.created_at as date_entry,

	tsds.updated_at as date_edit,

	COALESCE(tsds.updated_by,'SYSTEM')  as modify_username,

    concat(`tsds`.`doc_num`, '-', convert(right(concat('000', cast(row_number() over ( partition by `tsds`.`doc_num` order by `tsdsd`.`trans_sds_id`) as char(3) charset utf8mb3)), 3) using utf8mb4)) AS `sdsd_number`,

    row_number() over ( partition by `tsds`.`doc_num`

order by

    `tsdsd`.`trans_sds_id`) AS `sdsd_number_seq`,

	tsds.doc_num as sds_number,

	tsds.trans_date as sds_date,

	tpo.doc_num as po_number,

	    concat(`tpo`.`doc_num`, '-', convert(right(concat('000', cast(row_number() over ( partition by `tpo`.`doc_num` order by `tpo`.`id`) as char(3) charset utf8mb3)), 3) using utf8mb4)) AS `pod_number`,

	tpr.doc_num as pr_number,

concat(`tpr`.`doc_num`, '-', convert(right(concat('000', cast(row_number() over ( partition by `tpr`.`doc_num` order by `tpr`.`id`) as char(3) charset utf8mb3)), 3) using utf8mb4)) AS `prd_number`,

	mgd.description as department,

	mps.manual_id as supplier_code,

	mps.description as supplier_name,

	mps.prefix as supplier_initials,

	valtpd1.status_type_item as purchase_item_type,

	valms.sku_id,

	coalesce(valms.group_tag,'-') as item_group_code,

	valms.sku_name item_name,

	valms.sku_specification_code spesification_code,

	COALESCE(tsdsd.description,'-') AS description,

	valms.sku_sales_category as item_type_category,

	valms.sku_sub_category as item_type_sub_category,

	valms.sku_type as item_type_name,

	valmst.sku_classification as item_type_classification_status,

	valmst.trans_type as item_type_trading_status,

	valmst.is_primary as item_type_primary_status,

	valmst.checking_result as item_type_checking_status,

	valmst.checking_result as item_type_checking_result_status,

	valmst.is_bom as item_type_bom_status,

	valms.sku_sales_category as sales_category_name,

	valms.sku_inventory_unit as inventory_unit,

	valms.sku_procurement_type as procurement_type,

	valms.sku_procurement_unit as procurement_unit,

	valms.val_conversion as conversion_value,

	tsdsd.qty as quantity_sds,
	tsdsd.qty as outstanding_sds,

	case

		`tsds`.`flag_status`

		when 1 then 'Open'

		when 2 then 'Close'

		else 'Unknown'

	end AS `sds_status`,
	tsdsd.id

FROM

	trans_supplier_delivery_schedule_detail tsdsd

left join trans_supplier_delivery_schedule tsds on

	tsdsd.trans_sds_id = tsds.id

left join vw_app_list_log_sds_status vallsh on

	tsds.id = vallsh.trans_sds_id

left join trans_supplier_delivery_schedule tsds1 on

	tsds.new_id = tsds1.id

left join trans_purchase_order tpo on

	tpo.id = tsds.trans_po_id

left join mst_general_department mgd on

	mgd.id = tpo.gen_department_id

left join mst_person_supplier mps on

	mps.id = tpo.prs_supplier_id

left join trans_purchase_request tpr on

	tpr.id = tpo.purchase_request_id

left join trans_purchase_order_detail tpod on

	tpod.trans_po_id = tpo.id

left join vw_app_list_trans_pr_dt valtpd1 on

	valtpd1.id = tpod.pr_detail_id

left join vw_app_list_mst_sku valms on

	valms.id = tpod.sku_id

left join vw_app_list_mst_sku_type valmst on

	valmst.id = valms.sku_type_id

inner join vw_app_pick_trans_po_dt vaptpd on 

 vaptpd.po_detail_id = tpod.id

and tsdsd.po_detail_id = tpod.id 

 WHERE tsds.id= trg_sds_id;



  #Insert Header (new)

  DELETE

    FROM yrhmyid_db_edi.trans_supplier_delivery_schedule

  WHERE id = trg_sds_id;



  INSERT INTO yrhmyid_db_edi.trans_supplier_delivery_schedule (id, trans_date, description, doc_num, doc_counter, rev_counter, rev_date, flag_status, flag_delivery, flag_shipment,

  flag_active, created_by, created_at, updated_by, updated_at, deleted_by, deleted_at, manual_id, generated_id, prs_supplier_id,

  old_id, new_id)



    SELECT

      tsds.id,

      tsds.trans_date,

      tsds.description,

      tsds.doc_num,

      tsds.doc_counter,

      tsds.rev_counter,

      tsds.rev_date,

      tsds.flag_status,

      tsds.flag_delivery,

      tsds.flag_shipment,

      tsds.flag_active,

      tsds.created_by,

      tsds.created_at,

      tsds.updated_by,

      tsds.updated_at,

      tsds.deleted_by,

      tsds.deleted_at,

      tsds.manual_id,

      tsds.generated_id,

      tsds.prs_supplier_id,

      tsds.old_id,

      tsds.new_id

    FROM trans_supplier_delivery_schedule tsds

    WHERE tsds.id = trg_sds_id;



  #Insert Detail (new)

  INSERT INTO yrhmyid_db_edi.trans_supplier_delivery_schedule_detail (id, description, qty, flag_status, created_by, created_at, updated_by, updated_at, deleted_by, deleted_at, manual_id,

  generated_id, trans_sds_id, po_detail_id)



    SELECT

      tsdsd.id,

      tsdsd.description,

      tsdsd.qty,

      tsdsd.flag_status,

      tsdsd.created_by,

      tsdsd.created_at,

      tsdsd.updated_by,

      tsdsd.updated_at,

      tsdsd.deleted_by,

      tsdsd.deleted_at,

      tsdsd.manual_id,

      tsdsd.generated_id,

      tsdsd.trans_sds_id,

      tsdsd.po_detail_id

    FROM trans_supplier_delivery_schedule_detail tsdsd

    WHERE tsdsd.trans_sds_id = trg_sds_id;





  #Update Flag EDI

  CALL sp_log_sds_status(trg_sds_id, 3, trg_createdby);

END ;;
DELIMITER ;
