CREATE  PROCEDURE `sp_trans_sds_sent_edi_backup`(IN trg_sds_id bigint, IN trg_createdby varchar(50))
BEGIN

  #Insert Header

  INSERT INTO yrhmyid_db_edi.tb_supplier_delivery_schedule (date_entry, date_edit, modify_username, sds_number, sds_number_seq, sds_date, department, po_number, pr_number,

  supplier_code, supplier_name, supplier_initials, sds_status, sds_revision_status, sds_revision_date, edi_status,

  delivery_status, shipment_status, sds_sending_date, sds_received_date, sds_pulled_back_date, sds_reschedule_date,

  sds_reschedule_sds_number)



    SELECT

      vaetsh.date_entry,

      vaetsh.date_edit,

      vaetsh.modify_username,

      vaetsh.sds_number,

      vaetsh.sds_number_seq,

      vaetsh.sds_date,

      vaetsh.department,

      vaetsh.po_number,

      vaetsh.pr_number,

      vaetsh.supplier_code,

      vaetsh.supplier_name,

      vaetsh.supplier_initials,

      vaetsh.sds_status,

      vaetsh.sds_revision_status,

      vaetsh.sds_revision_date,

      vaetsh.edi_status,

      vaetsh.delivery_status,

      vaetsh.shipment_status,

      vaetsh.sds_sending_date,

      vaetsh.sds_received_date,

      vaetsh.sds_pulled_back_date,

      vaetsh.sds_reschedule_date,

      vaetsh.sds_reschedule_sds_number

    FROM vw_app_export_trans_sds_hd vaetsh

    WHERE vaetsh.id = trg_sds_id;



  #Insert Detail

  INSERT INTO yrhmyid_db_edi.tb_supplier_delivery_schedule_details (date_entry, date_edit, modify_username, sdsd_number, sdsd_number_seq, sds_number, sds_date, po_number,

  pod_number, pr_number, prd_number, department, supplier_code, supplier_name, supplier_initials,

