      vaetsd.spesification_description,

      vaetsd.item_type_category,

      vaetsd.item_type_sub_category,

      vaetsd.item_type_name,

      vaetsd.item_type_classification_status,

      vaetsd.item_type_trading_status,

      vaetsd.item_type_primary_status,

      vaetsd.item_type_checking_status,

